func Test_mapBetweenArcLengths(t *testing.T) {
	tests := []struct {
		a1       []Fl
		a2       []Fl
		wantOut1 splitMap
		wantOut2 splitMap
		wantOk   bool
	}{
		{
			[]Fl{0, 1, 2, 3}, []Fl{0, 1, 2, 3}, splitMap{}, splitMap{}, true,
		},
		{
			[]Fl{0.2435399, 0.4719608, 0.70726687, 1}, []Fl{0.2371314, 0.4882852, 0.7089619, 1}, splitMap{}, splitMap{}, true,
		},
		{
			[]Fl{0.6944475, 1}, []Fl{0.6811506, 1}, splitMap{}, splitMap{}, true,
		},
		{
			[]Fl{0.6, 1}, []Fl{0.3, 1}, splitMap{0: []Fl{0.5}}, splitMap{1: []Fl{0.5}}, true,
		},
	}
	for _, tt := range tests {
		if gotOut1, gotOut2, ok := mapBetweenArcLengths(tt.a1, tt.a2); !(reflect.DeepEqual(gotOut1, tt.wantOut1) && reflect.DeepEqual(gotOut1, tt.wantOut1) && ok == tt.wantOk) {
			t.Errorf("mergeArcLengths() = %v, %v, want %v, %v", gotOut1, gotOut2, tt.wantOut1, tt.wantOut2)
		}
	}
}

func TestMapBetween(t *testing.T) {
	be1 := Bezier{Pos{}, Pos{0, 40}, Pos{50, 40}, Pos{60, 0}}
	c1, c2 := be1.splitAt(0.7)

	tu.AssertEqual(t, mapFromTo(Rect{be1.P0, be1.P3}, Rect{c1.P0, c2.P3}), Trans{1, Pos{}})
}

func TestSplit(t *testing.T) {
	fp1 := Stroke{
		Curves:     []Bezier{{Pos{X: 56.6, Y: 49.4}, Pos{X: 54.9, Y: 51.1}, Pos{X: 29.6, Y: 54.1}, Pos{X: 25.5, Y: 54.1}}, {Pos{X: 25.5, Y: 54.1}, Pos{X: 30.3, Y: 61.2}, Pos{X: 43.1, Y: 63.2}, Pos{X: 49.6, Y: 69.6}}, {Pos{X: 49.6, Y: 69.6}, Pos{X: 49.6, Y: 80.9}, Pos{X: 25.3, Y: 90.6}, Pos{X: 50.3, Y: 90.6}}, {Pos{X: 50.3, Y: 90.6}, Pos{X: 53.6, Y: 90.6}, Pos{X: 56.5, Y: 90.0}, Pos{X: 59.7, Y: 89.8}}},
		ArcLengths: []float32{0.30676216, 0.5867406, 0.9094817, 1},
	}
	fp2 := Stroke{
		Curves:     []Bezier{{Pos{X: 47.0, Y: 63.0}, Pos{X: 28.9, Y: 46.9}, Pos{X: 32.6, Y: 93.2}, Pos{X: 50.6, Y: 75.7}}, {Pos{X: 51.0, Y: 75.0}, Pos{X: 54.0, Y: 70.2}, Pos{X: 53.0, Y: 63.5}, Pos{X: 53.0, Y: 58.0}}, {Pos{X: 53.0, Y: 58.0}, Pos{X: 53.0, Y: 66.5}, Pos{X: 52.5, Y: 77.2}, Pos{X: 56.0, Y: 85.0}}},
		ArcLengths: []float32{0.48838153, 0.68698424, 1},
	}

	s1, s2, ok := mapBetweenArcLengths(fp1.ArcLengths, fp2.ArcLengths)
	tu.Assert(t, ok)
	fmt.Println(s1, s2)
	tu.AssertEqual(t, len(fp1.split(s1)), len(fp2.split(s2)))
}

