func TestShapeDistance(t *testing.T) {
	var (
		footprints []Stroke
		allShapes  []Shape
		groups     []int // index of the group the footprint belongs to
	)
	for i, g := range shapes {
		for _, s := range g.shapes {
			fp := newFp(s)
			allShapes = append(allShapes, s)
			footprints = append(footprints, fp)
			groups = append(groups, i)
		}
	}

	for i, fp := range footprints {
		groupIndex := groups[i]

		// compare distance with all the shapes
		// and assert it is minimal for the group
		maxInGroup, minOutsideGroup := Fl(0), Inf
		maxInGroup2, minOutsideGroup2 := Fl(0), Inf
		fmt.Printf("shape %d (%s, shapes[%d])\n", i, shapes[groupIndex].description, groupIndex)
		for j, fp2 := range footprints {
			d := distanceFootprints(fp, fp2)

			s1, s2 := allShapes[i], allShapes[j]
			d2 := shapeDistance(s1, s2)

			fmt.Printf("dist from %d : %v\n", j, d)
			fmt.Printf("dist shape from %d : %v\n", j, d2)
			isInGroup := groups[j] == groupIndex
			if isInGroup && d > maxInGroup {
				maxInGroup = d
			}
			if !isInGroup && d < minOutsideGroup {
				minOutsideGroup = d
			}
			if isInGroup && d2 > maxInGroup2 {
				maxInGroup2 = d2
			}
			if !isInGroup && d2 < minOutsideGroup2 {
				minOutsideGroup2 = d2
			}
		}

		fmt.Println()
		fmt.Println("Group shape distance max ->", maxInGroup2)
		fmt.Println("----------------------------------")
		fmt.Println()
		tu.Assert(t, maxInGroup < minOutsideGroup)
		// tu.Assert(t, maxInGroup2 < 30)
	}
}

func TestPrintShapes(t *testing.T) {
	i := 0
	for ng, group := range shapes {
		for j, s := range group.shapes {
			fp := newFp(s)
			printShape(t, generateFootprint(fp.Curves), fmt.Sprintf("fit_%d_char_%s_%d_version_%d", i, group.description, ng, j))
			i++
		}
	}
}

