func TestSymbolDistance(t *testing.T) {
	var (
		footprints []Footprint
		groups     []int // index of the group the footprint belongs to
	)
	for i, g := range symbols {
		for _, s := range g.symbols {
			fp := newSymbolFootprint(s)
			footprints = append(footprints, fp)
			groups = append(groups, i)
		}
	}

	for i, fp := range footprints {
		groupIndex := groups[i]

		// compare distance with all the symbols
		// and assert it is minimal for the group
		maxInGroup, minOutsideGroup := Fl(0), Inf
		fmt.Printf("symbol %d (%s, symbols[%d])\n", i, symbols[groupIndex].description, groupIndex)
		for j, fp2 := range footprints {
			d := distanceSymbolsExact(fp, fp2)

			fmt.Printf("dist from %d : %v\n", j, d)
			isInGroup := groups[j] == groupIndex
			if isInGroup && d > maxInGroup {
				maxInGroup = d
			}
			if !isInGroup && d < minOutsideGroup {
				minOutsideGroup = d
			}
		}

		fmt.Println()
		fmt.Println("----------------------------------")
		fmt.Println()
		tu.Assert(t, maxInGroup < minOutsideGroup)
	}
}

func TestLookup(t *testing.T) {
	base := map[rune]Symbol{}
	for _, group := range symbols {
		r := rune(group.description[0])
		base[r] = group.symbols[0]
	}
	db := NewStore(base)

	for _, group := range symbols {
		expectedRune := rune(group.description[0])
		for _, symbol := range group.symbols {
			gotRune, _ := db.Lookup(symbol.Footprint(), Context{})
			tu.AssertEqual(t, string(gotRune), string(expectedRune))
		}
	}

	invalid, _ := db.Lookup(Symbol{{{}}, {{}}, {{}}, {{}}}.Footprint(), Context{})
	tu.AssertEqual(t, invalid, rune(0))
}

func TestPrintSymbols(t *testing.T) {
	i := 0
	for ng, group := range symbols {
		for j, s := range group.symbols {
			symbol := newSymbolFootprint(s)
			var total Shape
			for _, fp := range symbol.Strokes {
				total = append(total, generateFootprint(fp.Curves)...)
			}
			printShape(t, total, fmt.Sprintf("fit_%d_symbol_%s_%d_version_%d", i, group.description, ng, j))
			i++
		}
	}
}

func (db Store) get(r rune) Footprint {
	for _, v := range db.Symbols {
		if r == v.R {
			return v.Footprint
		}
	}
	return Footprint{}
}

func printComparisonDetails(t *testing.T, U, V Stroke, name string) {
	tr := mapFromTo(U.controlBox(), V.controlBox())
	U = U.scale(tr)

	c1, c2, _ := adjustFootprints(U, V)
	for i := range c1 {
		printShape(t, append(c1[i].toPoints(), c2[i].toPoints()...), fmt.Sprintf("%s_details_%d", name, i))
	}
}

