func loadStore(t *testing.T) *Store {
	dbPath, _ := os.UserHomeDir()
	dbPath = filepath.Join(dbPath, "pen2latex.store.json")
	db, err := NewStoreFromDisk(dbPath)
	if err != nil {
		t.Skipf("no user DB : %s", err)
	}
	return &db
}

